import { Container, Row, Col } from 'react-bootstrap';

function About() {
  return (
	<Container className="pt-5 mt-5">
		<h1>About Us</h1>
		<p>20 years experience with residential and commercial cleaning. We offer free quotes with the most competitive prices in town, offering exceptional cleaning services to make your life easier.</p>
	</Container>
  );
}

export default About;
